import { Component, ImageBanner } from "./styles"


const VideoComponent = () => {
  return (
    <Component>
      <ImageBanner src="https://i.ytimg.com/vi/PFQgajrcPeU/hq720_live.jpg?sqp=CLza6qgG-oaymwEcCNAFEJQDSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLDFI2AftBWF85ChqWZP0HJtc-sSpQ" />
    </Component>
  )
}

export default VideoComponent;
